import React from 'react';
import { useImagenContext } from '../context';

function ImagenCargadaCaptura() {
  const { imagenCapturada } = useImagenContext();
  return (
    <div>
      {imagenCapturada && (
        <div>
          <img
            src={imagenCapturada}
            alt="Imagen capturada"
            className='result'
            style={{ width: '200px', height: '300px' }}
            />
            </div>
          )}
        </div>
      );
    } 

export default ImagenCargadaCaptura;
